objetoCompra:
Contratação de empresa especializada para a recarga e manutenção nível dois de extintores de incêndio para a Subseção Judiciária de Pouso Alegre/MG, conforme quantidades e especificações abaixo:
- 04 (quatro) extintores com carga de água, volume de 10 litros, capacidade extintora 2-A;
- 03 extintores com carga de dióxido de carbono (CO2), de 6kg e capacidade extintora 5-B:C;
- 04 extintores com carga de pó químico NaHCO3, de 6kg e capacidade extintora 20-B:C;
- 09 extintores Classe 4A, com carga de pó químico NaHCO3, de 8kg e capacidade extintora 40-B:C.

informacaoComplementar:
Fornecimento e instalação dos seguintes materiais:
? Placas adesivadas, em chapa de alumínio composto (ACM) para:
- Identificação do CEJUSC (Centro Judiciário de Solução Consensual de Conflitos e Cidadania) e do CEJURE (Centro De Justiça Restaurativa);
- Informação do horário de expediente da Subseção Judiciária de Uberlândia, assim como, do horário de atendimento da Caixa Econômica Federal;
- Identificação do acesso à rampa de acessibilidade e informação do horário de atendimento da Subseção Judiciária de Uberlândia;
? Insulfilme para redução da incidência da luz solar e do calor na fachada envidraçada da portaria principal de entrada da Subseção;
? Placa em acrílico, com o símbolo CEJURE (Centro de Justiça Restaurativa) e texto para fixação na parede ao fundo do CEJURE, com pintura automotiva;
? Adesivos para orientação dos usuários no uso das catracas de acesso da portaria principal, indicando o sentido de circulação de entrada e de saída, bem como o procedimento de manuseio dos cartões pelos visitantes: leitura na entrada e recolhimento nas coletoras na saída.
? Faixas adesivadas para a sinalização das divisórias internas envidraçadas, visando a segurança dos usuários que circulam pelos locais.

